                        <div class="tab-pane" id="administrasi">
                            <div class="timeline-item" id="administrasi_last"><h1><strong>Pelayanan Administrasi Terpadu
                                        Kecamatan (PATEN)</strong></h1>

                                <p>Pelayanan Administrasi Terpadu Kecamatan (PATEN) adalah penyelenggaraan pelayanan
                                    publik
                                    di kecamatan yang proses pengelolaannya, mulai dari permohonan sampai ke tahap
                                    terbitnya
                                    dokumen dilakukan dalam satu tempat melalui satu loket pelayanan. Warga cukup
                                    menyerahkan berkas ke petugas meja/loket pelayanan, duduk menunggu sejenak, kemudian
                                    dipanggil untuk menerima dokumen yang sudah selesai. Setelah itu melakukan
                                    pembayaran
                                    (bila ada tarif yang harus dibayar). Pembayaran biaya pelayanan pun dilakukan dan
                                    dicatat secara transparan, karena semua tercatat dan dilaporkan. Selain itu,
                                    persyaratan
                                    untuk memperoleh pelayanan, besarnya biaya dan waktu untuk memproses pun ada
                                    standarnya.</p>

                                <p><br>PATEN diselenggarakan dengan maksud untuk mewujudkan kecamatan sebagai pusat
                                    pelayanan masyarakat, secara kondisi geografis daerah akan lebih efektif dan efisien
                                    di
                                    layani melalui kecamatan. Untuk mewujudkan kecamatan sebagai pusat pelayanan
                                    tersebut,
                                    maka syarat yang harus dipenuhi adalah adanya pelimpahan sebagian wewenang dari
                                    bupati
                                    kepada camat,.Dengan demikian, pelayanan yang dilakukan oleh kecamatan menjadi lebih
                                    berkualitas, mudah, murah, cepat, dan transparan.</p></div>
